import React from 'react';
import { useParams } from 'react-router-dom';

export const PropertyDetail = () => {
  const { id } = useParams();

  // Sample property data (dummy data)
  const propertyDetails = {
    1: { 
      title: 'Olivia Court', 
      location: 'Lekki, Lagos', 
      introduction: 'Olivia Court is a premium residential property located in the heart of Lekki. It offers a modern living experience with a blend of luxury and comfort.', 
      description: 'Every apartment is meticulously crafted to embrace open-plan living, seamlessly blending functionality with style. Enjoy uninterrupted power supply, fully fitted kitchens, and a luxurious fitness center, all designed to elevate your living experience.',
      image: '/img/intro-bg.png',
      video: 'https://www.youtube.com/embed/samplevideo1',
      logo: '/img/company-logo.png' // Add company logo
    },
    2: { 
      title: 'Property 2', 
      location: 'Victoria Island, Lagos', 
      introduction: 'This luxurious property offers a sophisticated living environment in the heart of Victoria Island. Perfect for those seeking elegance and convenience.',
      description: 'Experience the convenience of modern living with luxury features such as a swimming pool, state-of-the-art fitness center, and hand-crafted furniture.',
      image: '/img/intro',
      video: 'https://www.youtube.com/embed/samplevideo2',
      logo: '/img/company-logo.png'
    },
    3: { 
      title: 'Property 3', 
      location: 'Ikoyi, Lagos', 
      introduction: 'A prestigious residential property located in one of the most exclusive areas in Lagos. Ideal for individuals or families looking for top-notch amenities and services.',
      description: 'Luxury living at its finest, with spacious living rooms, custom furnishings, and access to all major amenities.',
      image: '/img/03-large.jpg',
      video: 'https://www.youtube.com/embed/samplevideo3',
      logo: '/img/company-logo.png'
    },
  };

  const property = propertyDetails[id];

  if (!property) {
    return <div>Property not found.</div>;
  }

  return (
    <div className="property-detail-container">
      {/* Main Content Area */}
      <div className="main-content">
        {/* Media Section */}
        <div className="media-section">
          <iframe
            width="100%" 
            height="315" 
            src={property.video}
            frameBorder="0"
            allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
            allowFullScreen
            title={property.title}
          />
        </div>
        
        {/* Details Section */}
        <div className="details-section">
          <h1>{property.title}</h1>
          <h2>{property.location}</h2>

          {/* Property Introduction */}
          <div className="property-introduction">
            <h3>Introducing {property.title}</h3>
            <p>{property.introduction}</p>
          </div>
          
          {/* Property Description */}
          <p>{property.description}</p>

          {/* Features List */}
          <ul className="features-list">
            <li>Luxury Living Rooms</li>
            <li>Quality Hand-Made Furniture</li>
            <li>Fully Fitted Kitchen</li>
            <li>Uninterrupted Power Supply</li>
            <li>Swimming Pool</li>
            <li>Fitness Center and Lounge</li>
          </ul>
          
          <button className="read-brochure-btn">Read Project Brochure</button>
        </div>
      </div>

      {/* Right Sidebar for Logo */}
      <div className="logo-section">
        <img src={property.logo} alt="Company Logo" className="company-logo" />
      </div>
    </div>
  );
};

export default PropertyDetail;
